proc glm data = VLMDS;
  where FLAGVAR='Y' and PARAMCD="ACTOT";
  class SITEGR1;
  model ANALVAR1 = TRTPN SITEGR1;
run;

proc glm data = VLMDS;
  where FLAGVAR='Y' and PARAMCD="ACTOT";
  class TRTPN SITEGR1;
  model ANALVAR1 = TRTPN SITEGR1 BASE;
  means TRTPN;
  lsmeans TRTPN / OM STDERR PDIFF CL;
run;
